        <a className="text-white" href="/">Tennis App</a>
      </div>
      <div className="container p-5">
         <div className="row">
         <div className="col-md-5">
        <div className="card">  

        <div className="card card-header">Students</div>


           <div className="card card-body">
           <form>

             <input className="form-control" placeholder="name" type="text" />
             <input className="form-control" placeholder="Age" type="text" />
             <input className="form-control" placeholder="Group" type="text" />
             <input className="form-grpup" placeholder="Email" type="mail" />
             </form>
           </div>

        </div>
        </div>
        </div>
      </div>

      </div>
    );
  }
}

export default App;
